    return(
        <div className="expense-item">
            <div>
                <ExpenseDate date = {props.date} />
            </div>
                <expenseTitle title={props.tile}/>
                <div className="expense-item__price">${props.expense}</div>
        </div> //can only have one root element!
    )
}

export default ExpenseItem;
